import React from 'react';

const Dashboard = () => {
    return (
        <nav className="navbar">
            <div className="links">
                <link to="/dashboard">Dashboard</link>
                <link to="/login">Login</link>
            </div>
        </nav>
    )
}

export default Navbar;
